import { useState } from 'react';
import Header from './Header';
import "./FilterComponents.css";
import { usePreviousProps } from '@mui/utils';

function Date(props) {
    const [isVisible, setVisible] = useState(true);

    function handleChange(e) {
        props.setfilter("published",e.target.value, )
    }
    return(
        <div className="category border rounded filterContainer">
            <div  onClick={() => setVisible(!isVisible)}>
                <Header title="Dato"/> 
            </div>
                {isVisible &&        
                <div id="category-content" className='filterBody' onChange={handleChange.bind(this)}>
                    <div className="form-check">
                        <input className="form-check-input" value="today" type="radio" name="flexRadioDefault" id="flexRadioDefault1"/>
                        <label className="form-check-label" for="flexRadioDefault1">
                            I dag
                        </label>
                    </div>
                    <div className="form-check">
                        <input className="form-check-input" value="week" type="radio" name="flexRadioDefault" id="flexRadioDefault2"/>
                        <label className="form-check-label" for="flexRadioDefault2">
                            I uka
                        </label>
                    </div>            
                    <div className="form-check">
                        <input className="form-check-input" value="month" type="radio" name="flexRadioDefault" id="flexRadioDefault2"/>
                        <label className="form-check-label" for="flexRadioDefault2">
                            I måned
                        </label>
                        
                    </div>            
                </div>
                }
        </div>
    )
}

export default Date;
